function set_view_for_template() {

	if (selected_template_type == 'postcard') {
		$('#envelopePreview').hide();
		$('.letter-one-disc').hide();
		$('#envelopePreviewNew').hide();
	} else {
		if (selected_template_index == 0) {
			$('.letter-one-disc').show();
			$('#envelopePreview').hide();
			$('#envelopePreviewNew').show();
		} else {
			$('.letter-one-disc').hide();
			$('#envelopePreview').show();
			$('#envelopePreviewNew').hide();
		}

		if (selected_template_type == 'letter' && selected_template_index == 0) {
			if ($('#envelope').prop('checked') == false) {
				$('#envelope').click();
			}
		} else {
			if ($('#envelope').prop('checked') == true) {
				$('#envelope').click();
			}
		}
	}
}
